tables.table_schema:
CREATE TABLE qubit_states (
    qubit_id INT PRIMARY KEY,
    state VARCHAR(50) NOT NULL,
    entangled_with INT
);

CREATE TABLE qubits (
    qubit_id INT PRIMARY KEY,
    state VARCHAR(50) NOT NULL
);
CREATE TABLE entangled_pairs (
    pair_id INT PRIMARY KEY,
    qubit1_id INT NOT NULL,
    qubit2_id INT NOT NULL,
    entanglement_strength FLOAT,
    FOREIGN KEY (qubit1_id) REFERENCES qubits(qubit_id),
    FOREIGN KEY (qubit2_id) REFERENCES qubits(qubit_id)
);

CREATE TABLE qubit_states (
    qubit_id SERIAL PRIMARY KEY,
    state VARCHAR(50) NOT NULL,
    entangled_with INTEGER
);
CREATE TABLE qubit_measurements (
    measurement_id SERIAL PRIMARY KEY,
    qubit_id INTEGER REFERENCES qubit_states(qubit_id),
    measurement_result VARCHAR(10) NOT NULL,
    measurement_time TIMESTAMP
);
CREATE TABLE entanglement_relations (
    relation_id SERIAL PRIMARY KEY,
    qubit1_id INTEGER REFERENCES qubit_states(qubit_id),
    qubit2_id INTEGER REFERENCES qubit_states(qubit_id),
    entanglement_strength FLOAT
);

CREATE TABLE qubit_states (
    qubit_id SERIAL PRIMARY KEY,
    state VARCHAR(50) NOT NULL,
    entangled_with INTEGER
);

CREATE TABLE entanglement_relations (
    relation_id SERIAL PRIMARY KEY,
    qubit_id_1 INTEGER NOT NULL,
    qubit_id_2 INTEGER NOT NULL,
    entanglement_strength FLOAT
);

CREATE TABLE quantum_measurements (
    measurement_id SERIAL PRIMARY KEY,
    qubit_id INTEGER NOT NULL,
    measurement_result VARCHAR(10) NOT NULL,
    measurement_time TIMESTAMP
);

CREATE TABLE quantum_gates (
    gate_id SERIAL PRIMARY KEY,
    gate_name VARCHAR(50) NOT NULL,
    gate_description TEXT
);

CREATE TABLE quantum_circuits (
    circuit_id SERIAL PRIMARY KEY,
    circuit_name VARCHAR(50) NOT NULL,
    circuit_description TEXT
);
